import logo from './images/meoimeoi_logo_co.png';
import LinkSection from './LinkSection';
import LinkOptions from './LinkOptions';
import { useState } from 'react';

import './meoimeoi-light-mode.css';

function Meoi() {
  // default to about
  state = {
    selected: LinkOptions.development,
  }
  function selectLink() {
    this.state.selected = true;
  }
  return (
    <div className="Meoi">
      <header className="Meoi-header">
        <img src={logo} className="Meoi-logo" alt="logo" />
        <LinkSection section={LinkOptions.development} onclick={selectLink(LinkOptions.development)}/>
      </header>
    </div>
  );
}

export default Meoi;
